import React from "react";
import { Link } from "react-router-dom";
import useCoins from "../../hooks/list";
import "./Navbar.css";
import ada from "../../assets/icons/ada_cardano_icon.png";
import bitcoin from "../../assets/icons/bitoin_btc_coin_crypto_icon.png";
import sol from "../../assets/icons/sol_blockchain_coins_cryptocurrency_crypto_icon.png";
import tron from "../../assets/icons/coin_trn_tron_icon.png";
import eth from "../../assets/icons/crypto_eth_ethcoin_etherium_icon.png";
import ltc from "../../assets/icons/coin_crypto_lite_litecion_ltc_icon.png";
import dog from "../../assets/icons/blockchain_dogecoin_icon.png";
import tether from "../../assets/icons/blockchain_tether_icon.png";

interface INavbarProps {
  handleChange: (e: React.ChangeEvent<HTMLInputElement>) => void;
  value: string;
}

export default function Navbar(props: INavbarProps) {
  const { handleChange, value } = props;
  return (
    <div className="navbar">
      <div className="search-box">
        <div className="container-2">
          <span className="icon">
            <i className="fa fa-search"></i>
          </span>
          <input
            type="search"
            id="search"
            onChange={handleChange}
            value={value}
            placeholder={"Search coins..."}
          />
        </div>
      </div>
      <div className="icon-coins">
        <img />
      </div>
      <div className="api-attribution">
        <p>Data from CoinGecko</p>
        <p>
          Created by
          <span>
            <a href="https://github.com/Vladyslavos" target={"_blank"}>
              Vladyslavos
            </a>
          </span>
        </p>
      </div>
    </div>
  );
}
